import React from 'react'
import { useLocation,useParams } from 'react-router-dom'
import axios from 'axios';



import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';


function createData(
  name: string,
  calories: number,
  fat: number,
  carbs: number,
  protein: number,
) 
{
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
  createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
  createData('Eclair', 262, 16.0, 24, 6.0),
  createData('Cupcake', 305, 3.7, 67, 4.3),
  createData('Gingerbread', 356, 16.0, 49, 3.9),
];

const Crypto = () => {
  const x = useParams().id;
  axios.get(`https://coinranking1.p.rapidapi.com/coin/${x}`,{
    params: {referenceCurrencyUuid: `${x}`, timePeriod: '24h'},
    headers: {
    'X-RapidAPI-Key': '7cf9598f86mshbf1d594046b0bbap174be7jsn287c463a1d1f',
    'X-RapidAPI-Host': 'coinranking1.p.rapidapi.com'
  }
  })
  .then((response)=>{console.log('response', response)})
  .catch((error)=>{console.log('error', error)})
  return (
    <div>
    {
      useParams().id &&
      <div>
        <div className="mainNavBar">
          <div className="subPart">
            <div className="mainPage">
              <div className='cur'>
                <h2>Bitcoin (BTC) Price</h2>
                <p>Bitcoin live price in Indian Rupees (RS). View value statistics, market cap and supply.</p>
              </div>
              <div className='cur-table'>
                  <div>
                    <h3>Bitcoin value statistics</h3>
                    <p>An overview showing the statistics of Bitcoin, such as the base and quote currency, the rank, and trading volume.</p>
                    <TableContainer component={Paper}>
                    <Table sx={{ minWidth: 650 }} aria-label="simple table">
                      <TableHead>
                        <TableRow>
                          <TableCell>Dessert (100g serving)</TableCell>
                          <TableCell align="right">Calories</TableCell>
                          <TableCell align="right">Fat&nbsp;(g)</TableCell>
                          <TableCell align="right">Carbs&nbsp;(g)</TableCell>
                          <TableCell align="right">Protein&nbsp;(g)</TableCell>
                        </TableRow>
                      </TableHead>
                      <TableBody>
                        {rows.map((row) => (
                          <TableRow
                            key={row.name}
                            sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                          >
                            <TableCell component="th" scope="row">
                              {row.name}
                            </TableCell>
                            <TableCell align="right">{row.calories}</TableCell>
                            <TableCell align="right">{row.fat}</TableCell>
                            <TableCell align="right">{row.carbs}</TableCell>
                            <TableCell align="right">{row.protein}</TableCell>
                          </TableRow>
                        ))}
                      </TableBody>
                    </Table>
                  </TableContainer>
                  </div>
                  <div>
                    <h3>Other Stats Info</h3>
                    <p>An overview showing the statistics of Bitcoin, such as the base and quote currency, the rank, and trading volume.</p>
                  </div>
              </div>
            </div>
          </div>
          </div>
      </div>
    }
    </div>
  )
}

export default Crypto
